import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'

const hour = new Date().getHours();

const division = {
  color : "FF8000",
}

let result = () => {
  if (1 <= hour && hour <= 11) {
    return "Good Morning";
  }
  else if (12 <= hour && hour <= 19) {
    return "Good Afternoon";
  }
  else {
    return "Good Night";
  }
}

ReactDOM.render(
  < >
    <div style={{division}}>
      <h1>Hello Sir, <span style={{division}}>{result()}</span></h1>
    </div>
  </>
  , document.getElementById('root')
)
